import './App.css';
import React from 'react';
import LoginPage from './Components/Login/LoginPage';
import User from './Components/User/User';
import Admin from './Components/Admin/Admin';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import KeyDownload from './Components/User/Dashboard/KeyDownload';
import KeyRequest from './Components/User/Dashboard/KeyRequest';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/" component={LoginPage} exact/>
          <Route path="/User" component={User} exact/>
          <Route path="/User/KeyRequest" component={KeyRequest} exact/>
          <Route path="/User/KeyDownload" component={KeyDownload} exact/>
          <Route path="/Admin" component={Admin} exact/>
        </Switch>
        {/* <User /> */}
      </BrowserRouter>
    </div>
  );
}

export default App;
